sys_variable_value.value:
(function execute(inputs, outputs) {
	inputs = new FirstAdvantageSpokeUtils().trimStringInputs(inputs);
	if (inputs.status_code == '200') {
		outputs.status = "Succes";
		var response = JSON.parse(inputs.response);
		var package_details = {
			data: []
		};
		var payload = response.package_details;
		payload.map(function(item) {
			package_details.data.push({
				name: item.package_id,
				label: item.name
			});
		});
		outputs.tables = package_details;
	} else
		outputs = new FirstAdvantageSpokeErrorHandler().genericErrorHandler(
			inputs, outputs);  
})(inputs, outputs);

